import React from 'react';
import "./style.scss";

const NotFound = () => {
    return (
        <div className="bg-not-found bg-cover relative">
            <img className="w-100" src="https://cdn.svgator.com/images/2022/01/funny-404-error-page-design.gif" alt='404 Not Found'/>
        </div>
    );
};

export default NotFound;
